package br.com.cleofase.news.entity

import br.com.cleofase.news.dao.NewsDB
import java.util.*

class NewFactory {
    companion object {
        fun generateSomeNews(ownerId: Int, newsDB: NewsDB) {
            for (i in 1..10) {
                val new = New()
                new.title = generateTitle()
                new.description = generateBody()
                new.date = generateDate()
                new.photoData = generatePhotoData()
                new.ownerId = ownerId
                newsDB.newDAO().insertNew(new)
            }
        }

        private fun generateTitle(): String {
            val randomIndex: Int = Random().nextInt(10)
            return when(randomIndex) {
                0 -> "Cras eu sapien id dui"
                1 -> "Lorem ipsum dolor sit amet"
                2 -> "Mauris in ipsum non velit"
                3 -> "Aliquam viverra lectus"
                4 -> "Maecenas mollis eros et elit"
                6 -> "Curabitur vitae magna"
                7 -> "In at erat ultrices"
                8 -> "Donec finibus magna"
                9 -> "Ut gravida purus"
                else -> "Nullam iaculis tellus"
            }
        }

        private fun generateBody(): String {
            val randomIndex: Int = Random().nextInt(10)
            return when(randomIndex) {
                0 -> "Morbi iaculis nibh et tempus facilisis."
                1 -> "Aliquam suscipit diam vel est ornare faucibus."
                2 -> "Fusce vitae eros placerat, fringilla justo quis, vehicula justo."
                3 -> "Proin maximus massa ac mi vulputate ullamcorper."
                4 -> "Morbi sed est consequat, finibus metus ac, vestibulum ex."
                6 -> "Maecenas iaculis diam eget bibendum dignissim."
                7 -> "Nam at purus accumsan, posuere tortor eget, lacinia quam."
                8 -> "Etiam pretium lacus eu odio auctor rhoncus."
                9 -> "Nam et lorem eu dui hendrerit suscipit."
                else -> "Cras a ante eu odio semper bibendum at eget leo."
            }
        }

        private fun generateDate(): String {
            val randomIndex: Int = Random().nextInt(10)
            return when(randomIndex) {
                0 -> "11/09/2017"
                1 -> "18/12/1976."
                2 -> "26/12/2017."
                3 -> "13/10/1990."
                4 -> "07/04/2018"
                6 -> "04/03/2018"
                7 -> "09/08/2017"
                8 -> "15/09/2017"
                9 -> "10/12/1985"
                else -> "24/05/2017"
            }
        }

        private fun generatePhotoData(): String {
            val randomIndex: Int = Random().nextInt(3)
            return when(randomIndex) {
                0 -> ""
                1 -> ""
                2 -> ""
                else -> ""
            }
        }

    }
}